import React, { Component } from "react";

class UserFavoriteItinerary extends Component {
  componentDidMount() {
    this.props.user.favorite;
  }

  render() {
    return (
      <div>
        <h1>your Favorite Itinerary</h1>
        {this.props.user.favorite}
      </div>
    );
  }
}
const mapStateToProps = (state, ownProps) => {
  console.log("mamToState", state);

  return {
    itineraries: state.itineraries.itineraries,
    user: state.users,
    favorites: state.itineraries.favorites,
  };
};
const mapDispatchToProps = (dispatch) => ({
  fetchItinerariesByCityName: (city) =>
    dispatch(fetchItinerariesByCityName(city)),
});
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(UserFavoriteItinerary);
